/*
 * 13. 다음 결과를 출력하는 프로그램
 *	**********
	**********
	**********
	**********
	**********(5행10열)
 
  */
public class 반복문문제13 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		for(int i=1;i<=5;i++)
		{
			for(int j=1;j<=10;j++)
			{
				System.out.println("*");
				System.out.println();
			
			}
			
		}
		
	}

}
